""" def solve1(n: int) -> list[int]:
    x: int = 1
    for _ in range(n // 2):
        x *= 10

    m: dict[str, set[int]] = dict()

    for y in range(x, x * 10):
        s: str = str(y*y)
        s = ''.join(sorted(s))
        if s not in m:
            m[s] = set()
        m[s].add(y)

        if len(m[s]) == n:
            return list(m[s])

    assert False """

